import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

//import AppHeader from './components/header';
import AppLogin from '/Users/nicolemerriman/Desktop/wanderlogixs-app/src/components/logingsignup.js';
import AppItinerary from './components/itinerary';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/login">
            <AppLogin />
          </Route>
          <Route path="/itinerary">
            <AppItinerary />
          </Route>
          <Route path="/">
            {/* Default route, can be a home page or redirect */}
            {/* <HomePage /> */}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
